import React from "react";
import emojipedia from "../emojipedia";
import Entry from "./Entry";

function createEntry(emo) {
  return (
    <Entry
      id={emo.id}
      emoji={emo.emoji}
      name={emo.name}
      meaning={emo.meaning}
    />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">{emojipedia.map(createEntry)}</dl>
    </div>
  );
}

export default App;
